import React, { Component } from "react";
import Login from "./components/login";
import './App.css';

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <main className="buttons">
          <Login />>
          <header className="App-header">
            Login
        </header>
        </main>
      </React.Fragment>
    );
  }
}

export default App;
